void conv_img(int u, int v, int (image)[1][121])
{
    int colors[11*11];
    for (int i = 0; i < 11*11; i++)
    {
        colors[i] = image[1][i];
    }
    uLCD.BLIT(u, v, 11, 11, colors);
    wait_us(250); // Recovery time!
}

void conv_img_2(int (image)[1][16384])
{
    int colors[128*128];
    for (int i = 0; i < 128*128; i++)
    {
        colors[i] = image[1][i];
    }
    uLCD.BLIT(0, 0, 128, 128, colors);
    wait_us(250); // Recovery time!
}

